        $('#return-to-top-form').fadeIn(200);    // Fade in the arrow
    } else {
        $('#return-to-top-form').fadeOut(200);   // Else fade out the arrow
    }
});
$('#return-to-top-form').click(function() {      // When arrow is clicked
    $('body,html').animate({
        scrollTop : 0                       // Scroll to top of body
    }, 500);
});

